from typing import List

class Solution:
    def threeSumMulti(self, A: List[int], target: int) -> int:
        result:int = 0
        dic = {}
        for num in A:
            if num in dic:
                dic[num] += 1
            else:
                dic[num] = 1
        keys = dic.keys()
        for key_i in keys:
            for key_j in keys:
                key_k = target - key_i - key_j
                if key_k in keys:
                    if key_i == key_j and key_j == key_k:
                        result += dic[key_i] * (dic[key_i] - 1) * (dic[key_i] - 2) // 6
                    elif key_i == key_j:
                        result += dic[key_i] * (dic[key_i] - 1) * dic[key_k] // 2
                    elif key_i < key_j < key_k:
                        result += dic[key_i] * dic[key_j] * dic[key_k]
                    result %= 1000000007
        return result

    def threeSumMulti2(self, A: List[int], target: int) -> int:
        result = 0
        nums = A
        nums.sort()
        length = len(nums)
        for i in range(length):
            tmp = target - nums[i]
            left = i + 1
            right = length - 1
            while left < right:
                sum = nums[left] + nums[right]
                if sum == tmp:
                    # print("nums {} left {} ,right {}", nums[i], nums[left], nums[right])
                    if(nums[left] == nums[right]):
                        result += (right - left) * (right - left + 1) // 2
                        result %= 1000000007
                        left = right
                        # print(result)
                    else:
                        countLeft = 1
                        countRight = 1
                        left += 1
                        right -= 1
                        while left <= right and nums[left] == nums[left - 1]:
                            countLeft += 1
                            left += 1
                        while right >= left and nums[right] == nums[right + 1]:
                            countRight += 1
                            right -= 1
                        result += countLeft * countRight
                        result %= 1000000007
                        # print(result)
                elif sum < tmp:
                    left += 1
                else:
                    right -= 1
        return result


